import React from 'react';
import { Link } from 'react-router-dom';
import { Nav } from 'react-bootstrap';
const HeaderNavigation = () => {
    return (
        <div>
           {/* <Link to="/accueil"> Accueil </Link> 
           <Link to="/Voiture d'Occasion"> Voiture d'Occasion </Link> 
           <Link to="/Voiture de Luxe"> Voiture de Luxe </Link> 
           <Link to="/Pièces de Vehicules"> Pièces de Vehicules </Link> 
           <Link to="/Admin"> Admin </Link>  */}
           <Nav>
            <Nav.Item>
                    <Nav.Link to="/accueil">Accueil</Nav.Link>
                      </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-1">Voiture d'Occasion</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Voiture de Luxe </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Pièces de Vehicules </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link eventKey="link-2"> Admin </Nav.Link>
                    </Nav.Item>
            </Nav>
        </div>
    );
};

export default HeaderNavigation;
